import React, { Component } from 'react';
import {
  withStyles,
  TextField,
  Grid,
  Button,
  Box,
} from "@material-ui/core";
import styles from './styles';
class ModalGlobal extends Component {
  render() {
    const { classes , onClose } = this.props;
    return (
      <form>
              <Grid container>
                <Grid item md={12}>
                  <TextField
                    id="title"
                    label="Tiêu đề"
                    className={classes.textField}
                    margin="normal"
                  />
                </Grid>
                <Grid item md={12}>
                  <TextField
                    id="description"
                    label="Mô tả"
                    className={classes.textField}
                    margin="normal"
                  />
                </Grid>
                <Grid item md={12}>
                  <Box display="flex" flexDirection="row-reverse" mt={2}>
                    <Box ml={1}>
                      <Button
                        variant="contained"
                        onClick={onClose}
                        color="default"
                      >
                        Huỷ bỏ
                      </Button>
                    </Box>
                    <Button variant="contained" color="primary">
                      Lưu lại
                    </Button>
                  </Box>
                </Grid>
              </Grid>
            </form>
    );
  }
}

export default withStyles(styles)(ModalGlobal);
